import { useState } from "react";
import { BiSearch } from "react-icons/bi";
import Select from 'react-select'

const Search = () => {

  const [check, setCheck] = useState('')

  const options = [
    { value: 'Check', label: 'Check' },
    { value: 'UnCheck', label: 'UnCheck' },
  ]

  const checkHandler = () => {
    setCheck
  }

  return (
    <div className="w-full bg-white flex items-center justify-between mt-[45px] p-4">
      <div className="w-2/3 flex items-center relative ml-1">
        <BiSearch className="absolute top-1/2 -translate-y-1/2 right-3 text-slate-400 text-2xl" />
        <input className="bg-zinc-800 py-3 pr-10 text-sm rounded-full outline-none text-white w-full" type={"text"} placeholder="search..." />
      </div>
      <div className="w-1/3 flex items-center mr-1 h-full">
        <Select onChange={checkHandler} value={check} options={options} className="" />
      </div>
    </div>
  );
}

export default Search;
